import { Route, Routes } from "react-router-dom";

const BookRoutes = () => {
  return (
    <Routes>
      <Route path="/books" element={<BookLayout />}>
        <Route index element={<BookList />} />
        <Route path=":id" element={<Book />} />
        <Route path="new" element={<NewBook />} />
      </Route>
    </Routes>
  );
};

export default BookRoutes;
